import Card from '../Card'
import uwLogo from '../../assets/color-UWcrest-print.png'
import mePhoto from '../../assets/meAvatar.jpg'
import Router from "next/router"
import Head from 'next/head'

export default class TopBarNav extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            cardHeight: 40,
            currentPage: this.props.currentPage,
        }
    }



    render() {
        var selectColor1 = "#000000";
        var selectColor2 = "#000000";
        var selectColor3 = "#000000";
        var selectColor4 = "#000000";


        return (
            <div className='topbar'>
                {/* My name and wisconsin Image */}
                <Card clickable={false} height='100%' width='40vw'>
                    <img src={uwLogo} style={{ paddingLeft: 55, height: 70, maxWidth: 60 }}></img>
                    <text style={{ fontFamily: 'Gilroy', fontSize: 50, paddingLeft: 20, flex: 1 }}>
                        Max Johnson
                </text>
                </Card>

                {/* Home Button */}
                
                <Card clickable={true} height={this.state.cardHeight} width='13vw' onClick={() => Router.push("/")}>
                    <text style={{ paddingTop: 17, fontSize: 30, fontFamily: 'Gilroy', color: selectColor1, flex: 1 }}>
                        Home
                    </text>
                </Card>
                

                {/* Projects Button */}
                
                <Card clickable={true} height={this.state.cardHeight} width='13vw' onClick={() => Router.push("/projects")}>
                    <text style={{ paddingTop: 17, fontSize: 30, fontFamily: 'Gilroy', color: selectColor2, flex: 1}}>
                        Projects
                    </text>
                </Card>
                

                {/* Gallery Button */}
                
                <Card clickable={true} height={this.state.cardHeight} width='13vw' onClick={() => Router.push("/gallery")}>
                    <text style={{ paddingTop: 17, fontSize: 30, fontFamily: 'Gilroy', color: selectColor3 }}>
                        Gallery
                    </text>
                </Card>
                

                {/** Contact Button */}
                
                <Card clickable={true} height={this.state.cardHeight} width='13vw' onClick={() => Router.push("/contact")}>
                    <text style={{ paddingTop: 17, fontSize: 30, fontFamily: 'Gilroy', color: selectColor4 }}>
                        Contact
                    </text>
                </Card>
                

                {/**picture of me */}
                <Card clickable={false} height={this.state.cardHeight} width='8vw'>
                    <img className="avatar" src={mePhoto} style={{ borderRadius: '50%', height: 50, width: 50, transform: 'translate(0,20px)', position: 'absolute' }}>
                    </img>
                </Card>
            </div>
        )
    }
}
